import {
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  IconButton,
} from "@mui/material";

import { BiSkipNext, BiSkipPrevious } from "react-icons/bi";
import CompanyModal from "../Common/CompanyModal";
import { useState } from "react";
import LoanTextField from "../../Common/LoanTextField";
import LoanIconButton from "../../Common/LoanIconButton";
import { IoRefresh } from "react-icons/io5";
import { Link } from "react-router-dom";
import { useParams } from "react-router-dom";

const AddAccountForCompany = ({
  handleSkip,
  accountInfo,
  handleInputChangeAccountInfo,
  saveAccountInfo,
  handlePrevios,
}) => {
  const { companyId } = useParams();
  const [isCompanyAccountModalOpen, setIsCompanyAccountModalOpen] =
    useState(false);

  function handleGeneralCloseModal() {
    setIsCompanyAccountModalOpen(false);
  }

  function handleGeneralOpenModal() {
    setIsCompanyAccountModalOpen(true);
  }

  const [selectedCompanyAccount, setSelectedCompanyAccount] = useState();

  const onChangeselectedCompanyAccount = (e) => {
    setSelectedCompanyAccount(e.target.value);
  };

  return (
    <>
      <div className="flex">
        <Link to={`/contact/${companyId}`}>
          <LoanIconButton
            style={{ color: "purple" }}
            icon={<BiSkipPrevious />}
            text="Contact Information"
            onClick={handlePrevios}
          />
        </Link>
        <LoanIconButton
          style={{ color: "purple" }}
          //   icon={<FiPlus />}
          text="Add"
          onClick={handleGeneralOpenModal}
        />
         <Link to={`/account-detail/${companyId}`}>
          <LoanIconButton
            style={{ color: "purple" }}
            icon={<BiSkipNext />}
            text="Account "
            onClick={handleSkip}
          />
        </Link>
        {/* <Link to={`/trade/${companyId}`}>
          <LoanIconButton
            style={{ color: "purple" }}
            icon={<BiSkipNext />}
            text="Trade Registration"
            onClick={handleSkip}
          />
        </Link> */}
        path="/enterprise/account-detail/:companyId"
      </div>
      <CompanyModal
        isOpen={isCompanyAccountModalOpen}
        onClose={handleGeneralCloseModal}
        title="Add company Account information"
      >
        <div className="grid grid-cols-1 gap-4 submit-form">
          <div className="submit-form ">
            <div
              className="relative center justify-center
flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4"
            >
              {/* <LoanTextField
                id="DesignatedPersonFName"
                label="Designated Person First Name"
                value={contactInfo.DesignatedPersonFName}
                onChange={handleInputChangeContactInfo}
                name="DesignatedPersonFName"
              /> */}
              <LoanTextField
                id="AccountNo"
                label="Account Number"
                value={accountInfo.AccountNo}
                onChange={handleInputChangeAccountInfo}
                name="AccountNo"
              />
              <LoanTextField
                id="CustomerId"
                label="Customer Id"
                value={accountInfo.CustomerId}
                onChange={handleInputChangeAccountInfo}
                name="CustomerId"
              />
              <LoanTextField
                id="Branch"
                label="Branch"
                value={accountInfo.Branch}
                onChange={handleInputChangeAccountInfo}
                name="Branch"
              />
              <LoanTextField
                id="District"
                label="District"
                value={accountInfo.District}
                onChange={handleInputChangeAccountInfo}
                name="District"
              />
              <LoanTextField
                id="Other"
                label="Other"
                value={accountInfo.Other}
                onChange={handleInputChangeAccountInfo}
                name="Other"
              />
            </div>
          </div>
          <div className="flex justify-between">
            <button
              className="bg-gray-300 hover:bg-gray-400 text-gray-800 font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
              onClick={handleSkip}
            >
              Skip
            </button>

            <button
              className="bg-[purple] hover:bg-purple-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
              onClick={() => {
                saveAccountInfo();
              }}
            >
              Save
            </button>
          </div>
        </div>
      </CompanyModal>
    </>
  );
};
export default AddAccountForCompany;
